import React from 'react';
import { Jumbotron } from 'react-bootstrap';

const HeaderPokemon = props => {
  return (
    <div className='HeaderPokemon'>
      <Jumbotron>
        <h1>Hello Word with bootstrap 🎉</h1>
      </Jumbotron >
    </div >
  )
}

const CampoPesquisa = props => {
  return (
    <div className='CampoPesquisa'> </div>
  )
}

function App() {
  return (
    <div className='App'>
      <HeaderPokemon />
      <CampoPesquisa />
    </div>
  )
}

export default App
